import React from "react";
import styles from './AllyOffersLogo.css';

const AllyOffersLogo = () => {

    return (
        <div className='whole-logo'>
            <div className='ally-font'>
                ally
            </div>
            <div className='offers-font'>
                offers
            </div>
        </div>
    );
};

export default AllyOffersLogo;
